CREATE TABLE `employees` (
  `EmployeeID` int(11) NOT NULL AUTO_INCREMENT,
  `LastName` varchar(20) CHARACTER SET utf8mb4 NOT NULL,
  `FirstName` varchar(10) CHARACTER SET utf8mb4 NOT NULL,
  `Title` varchar(30) CHARACTER SET utf8mb4 DEFAULT NULL,
  `TitleOfCourtesy` varchar(25) CHARACTER SET utf8mb4 DEFAULT NULL,
  `BirthDate` datetime DEFAULT NULL,
  `HireDate` datetime DEFAULT NULL,
  `Address` varchar(60) CHARACTER SET utf8mb4 DEFAULT NULL,
  `City` varchar(15) CHARACTER SET utf8mb4 DEFAULT NULL,
  `Region` varchar(15) CHARACTER SET utf8mb4 DEFAULT NULL,
  `PostalCode` varchar(10) CHARACTER SET utf8mb4 DEFAULT NULL,
  `Country` varchar(15) CHARACTER SET utf8mb4 DEFAULT NULL,
  `HomePhone` varchar(24) CHARACTER SET utf8mb4 DEFAULT NULL,
  `Extension` varchar(4) CHARACTER SET utf8mb4 DEFAULT NULL,
  `Photo` longblob,
  `Notes` longtext,
  `ReportsTo` int(11) DEFAULT NULL,
  `PhotoPath` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL,
  PRIMARY KEY (`EmployeeID`),
  KEY `LastName` (`LastName`),
  KEY `PostalCode` (`PostalCode`),
  KEY `FK_Employees_Employees` (`ReportsTo`),
  CONSTRAINT `FK_Employees_Employees` FOREIGN KEY (`ReportsTo`) REFERENCES `employees` (`EmployeeID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;
